import { createRouter, createWebHistory } from "vue-router";
// import Home from "../views/Navbar.vue";
// import About from "../views/PortofolioPage.vue";z

const routes = [
  {
    path: "/",
    name: "Navbar",
    component: Home,
  },
  {
    path: "/portofolio",
    name: "PortofolioPage",
    component: About,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
